        static void CreateAMCDocument_Invoice(IOrganizationService _service)
        {
            int count = 0;
            int done = 1;
            int error = 0;
            try
            {
                #region Query

                LinkEntity lnkEntAddress = new LinkEntity
                {
                    LinkFromEntityName = "invoice",
                    LinkToEntityName = "hil_address",
                    LinkFromAttributeName = "hil_address",
                    LinkToAttributeName = "hil_addressid",
                    Columns = new ColumnSet("hil_fulladdress"),
                    EntityAlias = "address",
                    JoinOperator = JoinOperator.Inner
                };
                LinkEntity lnkEntConsumer = new LinkEntity
                {
                    LinkFromEntityName = "invoice",
                    LinkToEntityName = "contact",
                    LinkFromAttributeName = "customerid",
                    LinkToAttributeName = "contactid",
                    Columns = new ColumnSet("hil_salutation", "fullname", "emailaddress1", "mobilephone"),
                    EntityAlias = "contact",
                    JoinOperator = JoinOperator.Inner
                };
                LinkEntity lnkEntProduct = new LinkEntity
                {
                    LinkFromEntityName = "invoice",
                    LinkToEntityName = "product",
                    LinkFromAttributeName = "productid",
                    LinkToAttributeName = "hil_productcode",
                    EntityAlias = "product",
                    JoinOperator = JoinOperator.Inner
                };
                lnkEntProduct.LinkCriteria = new FilterExpression(LogicalOperator.And);
                lnkEntProduct.LinkCriteria.AddCondition("hil_hierarchylevel", ConditionOperator.Equal, 910590001);
                LinkEntity lnkEntProductCatlog = new LinkEntity
                {
                    LinkFromEntityName = "invoice",
                    LinkToEntityName = "hil_productcatalog",
                    LinkFromAttributeName = "hil_productcode",
                    LinkToAttributeName = "hil_productcode",
                    Columns = new ColumnSet("hil_name", "hil_amctandc"),
                    EntityAlias = "productCatlog",
                    JoinOperator = JoinOperator.Inner
                };
                lnkEntProductCatlog.LinkCriteria = new FilterExpression(LogicalOperator.And);
                lnkEntProductCatlog.LinkCriteria.AddCondition("statuscode", ConditionOperator.Equal, 1);

                QueryExpression Query = new QueryExpression("invoice");
                Query.ColumnSet = new ColumnSet("hil_customerasset", "name", "hil_salestype", "hil_productcode", "totallineitemamount", "hil_receiptamount",
                    "discountamount", "hil_productcode", "msdyn_invoicedate", "hil_newserialnumber", "hil_modelcode");
                Query.Criteria = new FilterExpression(LogicalOperator.And);
                Query.Criteria.AddCondition(new ConditionExpression("statecode", ConditionOperator.Equal, 2)); //Paid
                //Query.Criteria.AddCondition(new ConditionExpression("hil_isamcdocumentsend", ConditionOperator.NotEqual, true));
                Query.Criteria.AddCondition(new ConditionExpression("hil_receiptamount", ConditionOperator.GreaterThan, 0)); //Receipt amount must be grater than 0.
                Query.Criteria.AddCondition(new ConditionExpression("hil_salestype", ConditionOperator.Equal, 3));

                Query.Criteria.AddCondition(new ConditionExpression("name", ConditionOperator.Equal, "INV-2023-001723"));

                Query.AddOrder("msdyn_invoicedate", OrderType.Ascending);
                Query.LinkEntities.Add(lnkEntAddress);
                Query.LinkEntities.Add(lnkEntConsumer);
                Query.LinkEntities.Add(lnkEntProductCatlog);
                EntityCollection ec = _service.RetrieveMultiple(Query);
                #endregion
                AMCDocumentContent aMCDocumentContent = new AMCDocumentContent();
                count = ec.Entities.Count;
                done = 0;
                error = 0;
                Console.WriteLine("total Record found " + count);

                foreach (Entity ent in ec.Entities)
                {
                    if (true)
                    {
                        try
                        {
                            string srNo = string.Empty;
                            if (ent.Contains("hil_customerasset"))
                                srNo = ent.GetAttributeValue<EntityReference>("hil_customerasset").Name;
                            else if (ent.Contains("hil_newserialnumber"))
                                srNo = ent.GetAttributeValue<string>("hil_newserialnumber");
                            else if (ent.Contains("hil_modelcode"))
                                srNo = ent.GetAttributeValue<EntityReference>("hil_modelcode").Name;
                            aMCDocumentContent.SrNo = srNo;
                            aMCDocumentContent.Name = (string)ent.GetAttributeValue<AliasedValue>("contact.fullname").Value;
                            aMCDocumentContent.moblileNo = (string)ent.GetAttributeValue<AliasedValue>("contact.mobilephone").Value;
                            if (ent.Contains("contact.emailaddress1"))
                                aMCDocumentContent.EmailID = (string)ent.GetAttributeValue<AliasedValue>("contact.emailaddress1").Value;
                            aMCDocumentContent.AMCPlaneName = (string)ent.GetAttributeValue<AliasedValue>("productCatlog.hil_name").Value;
                            aMCDocumentContent.FullAddress = (string)ent.GetAttributeValue<AliasedValue>("address.hil_fulladdress").Value;
                            aMCDocumentContent.PaidAmount = Math.Round(ent.GetAttributeValue<Money>("hil_receiptamount").Value, 2).ToString();
                            string _warrantyDesc = (string)ent.GetAttributeValue<AliasedValue>("productCatlog.hil_amctandc").Value;
                            string[] lines = _warrantyDesc.Split('\n');
                            string list = @" <ul>";
                            foreach (string line in lines)
                            {
                                list = list + @"<li class='cls_007'>" + line + @"</li>";
                            }
                            list = list + @"</ul>";
                            aMCDocumentContent.List = list;
                            string _fileName = "AMCWC" + ent.Id + ".pdf";
                            string blobUrl = CreateAMCDocumentFile(aMCDocumentContent, _fileName);
                            Console.WriteLine("Document is Created and Uploaded in Blob for Job " + ent.GetAttributeValue<string>("msdyn_name") + " URL: " + blobUrl);
                            createAttachment(_service, ent.ToEntityReference(), blobUrl);
                            Console.WriteLine("Attachmetn is Created in Dynamics Against Job");

                            Console.WriteLine("Updating Job Extension");
                            Entity jobExtension = new Entity("invoice");
                            jobExtension["hil_isamcdocumentsend"] = true;
                            jobExtension.Id = ent.Id;
                            _service.Update(jobExtension);
                            Console.WriteLine("Invoice Updeted");
                            done++;
                            Console.WriteLine("Document  Created " + done + "/" + count);
                            Console.WriteLine("************************************************************************");
                        }
                        catch (Exception ex)
                        {
                            error++;
                            Console.WriteLine(error + "/" + count + "************Error on Record " + ex.Message);
                        }
                    }
                }
            }
            catch (Exception ex)
            {
                Console.WriteLine("^^^^^^^Error " + ex.Message);
            }
            Console.WriteLine("=================================================================================================");
            Console.WriteLine("Total Rec " + count + " || Comleted " + done + " || Error " + error);
            Console.WriteLine("=================================================================================================");
        }
        static string CreateAMCDocumentFile(AMCDocumentContent aMCDocumentContent, string _fileName)
        {
            string htmlBody = GetBody();
            htmlBody = htmlBody.Replace("<#CustomerName#>", aMCDocumentContent.Name);
            htmlBody = htmlBody.Replace("<#PlanName#>", aMCDocumentContent.AMCPlaneName);
            htmlBody = htmlBody.Replace("<#FullAddress#>", aMCDocumentContent.FullAddress);
            htmlBody = htmlBody.Replace("<#SerialNumber#>", aMCDocumentContent.SrNo);
            htmlBody = htmlBody.Replace("<#MobileNumber#>", aMCDocumentContent.moblileNo);
            htmlBody = htmlBody.Replace("<#ReciptAmount#>", aMCDocumentContent.PaidAmount);
            htmlBody = htmlBody.Replace("<#EmailID#>", aMCDocumentContent.EmailID);
            htmlBody = htmlBody.Replace("<#List#>", aMCDocumentContent.List);

            string blobUrl = HtmltoPdf(_fileName, htmlBody);
            return blobUrl;
        }
        public static string HtmltoPdf(string _fileName, string htmlBody)
        {
            string blobUrl = null;
            try
            {
                GlobalConfig gc = new GlobalConfig();
                gc.SetMargins(new System.Drawing.Printing.Margins(0, 0, 0, 0))
                    .SetDocumentTitle("Annual Maintenance Contract Acknowledgement Document")
                    .SetPaperSize(PaperKind.A4);

                IPechkin pechkin = new SynchronizedPechkin(gc);
                ObjectConfig configuration = new ObjectConfig();
                configuration
                .SetPrintBackground(true)
                .SetAllowLocalContent(true);
                byte[] pdfContent = pechkin.Convert(configuration, htmlBody);
                Console.WriteLine("Document is Created and Uploading in Blob ");
                blobUrl = Upload(_fileName, pdfContent, "warrantydocs");
            }
            catch (Exception ex)
            {
                Console.WriteLine("error");
            }

            return blobUrl;
        }
        static string Upload(string fileName, byte[] fileContent, string containerName)
        {
            Console.WriteLine("Upload to Blob Started");
            string _blobURI = string.Empty;
            try
            {
                //byte[] fileContent = Convert.FromBase64String(noteBody);
                string ConnectionSting = "DefaultEndpointsProtocol=https;AccountName=d365storagesa;AccountKey=6zw5Lx4X+zHrh+CAKLdgaWSqVZ1zC7AKugPkNEGevep6qhh1xRm5Q3DBWKGJ+DsWfCZk59BbLSJvja81DD4++w==;EndpointSuffix=core.windows.net";
                // create object of storage account
                CloudStorageAccount storageAccount = CloudStorageAccount.Parse(ConnectionSting);
                // create client of storage account
                CloudBlobClient client = storageAccount.CreateCloudBlobClient();
                // create the reference of your storage account
                CloudBlobContainer container = client.GetContainerReference(ToURLSlug(containerName));
                // check if the container exists or not in your account
                var isCreated = container.CreateIfNotExists();
                // set the permission to blob type
                container.SetPermissionsAsync(new BlobContainerPermissions
                { PublicAccess = BlobContainerPublicAccessType.Blob });
                // create the memory steam which will be uploaded
                using (MemoryStream memoryStream = new MemoryStream(fileContent))
                {
                    // set the memory stream position to starting
                    memoryStream.Position = 0;
                    // create the object of blob which will be created
                    // Test-log.txt is the name of the blob, pass your desired name
                    CloudBlockBlob blob = container.GetBlockBlobReference(fileName);
                    // get the mime type of the file
                    string mimeType = "application/unknown";
                    string ext = (fileName.Contains(".")) ?
                                System.IO.Path.GetExtension(fileName).ToLower() : "." + fileName;
                    Microsoft.Win32.RegistryKey regKey =
                                Microsoft.Win32.Registry.ClassesRoot.OpenSubKey(ext);
                    if (regKey != null && regKey.GetValue("Content Type") != null)
                        mimeType = regKey.GetValue("Content Type").ToString();
                    // set the memory stream position to zero again
                    // this is one of the important stage, If you miss this step, 
                    // your blob will be created but size will be 0 byte
                    memoryStream.ToArray();
                    memoryStream.Seek(0, SeekOrigin.Begin);
                    // set the mime type
                    blob.Properties.ContentType = mimeType;
                    // upload the stream to blob
                    blob.UploadFromStream(memoryStream);
                    _blobURI = blob.Uri.AbsoluteUri;
                }
            }
            catch (Exception ex)
            {
                throw new Exception("JobSheet.JobSheet.Upload: " + ex.Message);
            }
            Console.WriteLine("file uploaded");
            return _blobURI;
        }
        static string ToURLSlug(string s)
        {
            return Regex.Replace(s, @"[^a-z0-9]+", "-", RegexOptions.IgnoreCase)
                .Trim(new char[] { '-' })
                .ToLower();
        }
        public static void createAttachment(IOrganizationService service, EntityReference regardingEntity, string URL)
