            _attachment["hil_docurl"] = URL;
            if (regardingEntity.LogicalName == "invoice")
                _attachment["hil_documenttype"] = new EntityReference("hil_attachmentdocumenttype", new Guid("e0f06658-a6c7-ed11-b597-6045bdaf13b7"));
            else
                _attachment["hil_documenttype"] = new EntityReference("hil_attachmentdocumenttype", new Guid("72bbc67e-571f-ec11-b6e6-6045bd72d8a6"));
            _attachment["regardingobjectid"] = regardingEntity;
            service.Create(_attachment);
            Console.WriteLine("attachment created");
        }
