                                    <h3>Terms and Conditions of Annual Maintenance Contract </h3>
                                    <div class='innerText'>
                                        <p>This Maintenance contract (MAINTENANCE CONTRACT) is entered between Havells India limited (Havells)
                                            and the customer (Customer) specified on the reverse of this document in connection with maintenance
                                            of the product(s) specified ['Product(s)'] installed at the address of the Customer given as above.
                                            Under this MAINTENANCE CONTRACT, Havells shall provide replacement of functional parts, Consumables
                                            and periodical services for the Product(s) as applicable, subject to terms and conditions mentioned
                                            hereinafter.</p>
                                        <ol>
                                            <li>
                                                The respective MAINTENANCE CONTRACT will cover the services as per the below mentioned table:
                                                <#List#>
                                            </li>
                                            <li>
                                                The Product(s) must be in working condition for availing the MAINTENANCE CONTRACT by the
                                                Customer. On a Customer’s request at Havells’ customer care for availing MAINTENANCE CONTRACT, a
                                                Havells’ Service representative shall visit the Customer to certify the Product before the
                                                MAINTENANCE CONTRACT is granted.
                                            </li>
                                            <li>
                                                If the Product is not in a working condition, the Customer shall have to bear the necessary
                                                charges to get the Product in absolute working condition after which, the Customer will be
                                                entitled to a MAINTENANCE CONTRACT based on the certification as mentioned in the preceding
                                                clause (2).
                                            </li>
                                            <li>
                                                Thereafter the Customer shall make necessary payment for purchasing the MAINTENANCE CONTRACT
                                                from Havells.
                                            </li>
                                            <li>
                                                The Customer can pay the MAINTENANCE CONTRACT charges by Credit/Debit card/DD/Net banking/cheque
                                                in favor of the Havells in advance and proof of payment, in case of credit/debit card or Net
                                                banking and, DD/cheque shall be attached by the Customer at the time of signing the MAINTENANCE
                                                CONTRACT document. MAINTENANCE CONTRACT shall become effective only on realization of payment.
                                                This MAINTENANCE CONTRACT shall be valid for the period as mentioned in the MAINTENANCE CONTRACT
                                                invoice duly signed by the Havells’ authorized Service representative and shall be effective for
                                                the period as mentioned on the invoice (Effective Date).
                                            </li>
                                            <li>
                                                Preventive maintenance visits will be conducted twice from the Effective Date of this
                                                MAINTENANCE CONTRACT during the period of MAINTENANCE CONTRACT. Havells will use reasonable
                                                efforts to provide the preventive maintenance services at Customer’s place. However, the
                                                Customer shall also be responsible for informing Havells of any pending/upcoming preventive
                                                maintenance visit i.e. 175th day and 350th day from the Effective Date. In case any preventive
                                                maintenance visit is missed out by Havells and the Customer fails to intimate Havells when
                                                preventive maintenance visit is due and/or has lapsed by 15 days from said dates, preventive
                                                maintenance visit for that period shall get automatically cancelled. Customer will not be
                                                entitled to avail that particular preventive maintenance visit after its lapse or claim any loss
                                                incurred by the Customer due to the lapse of the preventive maintenance visit. The Preventive
                                                maintenance visit will be provided in terms of the table provided in clause 1.
                                            </li>
                                            <li>
                                                The Product should be made available to Havells’ service representative for undertaking the
                                                scheduled MAINTENANCE CONTRACT, failure to do so will be treated as a service rendered.
                                            </li>
                                            <li>
                                                Any additional service visit during the MAINTENANCE CONTRACT period in the event of any
                                                breakdown/malfunctioning of the Product on Customer’s complaint will be free of charge as per
                                                applicable MAINTENANCE CONTRACT type (mentioned in the table above as per Clause 1). In case of
                                                breakdown of the Product after the term of this MAINTENANCE CONTRACT, the Customer will be
                                                charged for the service visit and repair of the Product as per prevailing policy of Havells.
                                            </li>
                                            <li>
                                                Where any part /component of the Product is replaced during MAINTENANCE CONTRACT period due to
                                                failure of such part / component, Havells shall be entitled to take such failed part / component
                                                for further inspection.
                                            </li>
                                            <li>
                                                For the free replacement of spare parts as covered by the MAINTENANCE CONTRACT, tax wherever
                                                applicable, will be borne by Havells.
                                            </li>
                                            <li>
                                                Havells reserves the right to replace filters/cartridges/membrane based on findings during
                                                preventive maintenance /service calls. The replacement of the respective
                                                filter/cartridges/membranes will be provided in terms of the table provided in clause 1. .
                                            </li>
                                            <li>
                                                Havells works for continuous improvement of their Products, parts, filters, cartridges,
                                                membranes or any other components. Customer shall not object if the same is being replaced with
                                                compatible parts or components by Havells’ Service representative.
                                            </li>
                                            <li>
                                                Service under this MAINTENANCE CONTRACT excludes plastic parts, non-electrical parts, painting
                                                of the body, aesthetical parts, panels and other styling decorative materials.
                                            </li>
                                        </ol>
                                    </div>
                                </div>
                                <div class='image'>
                                    <img src='data:image/png;base64,'
                                        alt='Footer' />
                                </div>

                                <div class='image'>
                                    <img src='data:image/png;base64,'
                                        alt='Header' />
                                </div>
                                <div class='bodySectoin'>
                                    <div class='innerText'>
                                        <ol start='14'>
                                            <li>
                                                MAINTENANCE CONTRACT shall not be applicable in case the Product is used for commercial purpose.
                                                In case a Product is converted to commercial after taking of the MAINTENANCE CONTRACT, in such
                                                case MAINTENANCE CONTRACT shall stand terminated and the Customer shall not be entitled to any
                                                refund or damages in any manner whatsoever.
                                            </li>
                                            <li>
                                                In case the Customer wants to terminate the MAINTENANCE CONTRACT before completion of the
                                                MAINTENANCE CONTRACT period, Havells shall not be liable to refund any amount for remaining
                                                tenure of MAINTENANCE CONTRACT.
                                            </li>
                                            <li>
                                                Acceptance/renewal of the MAINTENANCE CONTRACT after its expiry will be at the sole discretion
                                                of Havells. Such renewal may be subject to revised terms and conditions including revised
                                                MAINTENANCE CONTRACT charges. Customer will not be entitled for any charges / claims in case of
                                                non-renewal of the MAINTENANCE CONTRACT.
                                            </li>
                                            <li>
                                                The MAINTENANCE CONTRACT shall not cover service visits or replacement of parts under the
                                                following circumstances:
                                                <ol type='a'>
                                                    <li>
                                                        Damage caused to the Product due to floods, fire, accident, riot, breakage, pest, rate
                                                        bite, misuse, improper or negligent use, tampering, and leakage from water Pipe lines,
                                                        substitution/alteration of any Part and serial number of Product/part is altered,
                                                        defaced or removed, etc.
                                                    </li>
                                                    <li>
                                                        Damage caused to the Product due to failure to observe the operating instructions and
                                                        precautions as mentioned in user’s manual;
                                                    </li>
                                                    <li>
                                                        Damage to the Product or any parts due to transportation/relocation;
                                                    </li>
                                                    <li>
                                                        Defects occurred due to usage of local or non-recommended spares, consumables;
                                                    </li>
                                                    <li>
                                                        Visits for re-demonstration at Customer’s request or for re-installation at a different
                                                        location.
                                                    </li>
                                                    <li>
                                                        Defects or failures resulting from servicing or repair done by any unauthorized person
                                                        i.e. other than the Havells’ authorized Service representative;
                                                    </li>
                                                    <li>
                                                        Failure or damage due to plumbing or other arrangement like usage of pressure pump,
                                                        extension power supply board, non-compatible power socket etc. connected to Product.
                                                        With regard to repairing the existing worn-out/defective part(s) or replacing the same
                                                        and ascertaining the presence of above circumstances, the decision of Havells shall be
                                                        final.
                                                        In any such event, Havells will provide a prior estimate to the Customer for approval
                                                        and bill for the work to be carried out at the rate prevailing at that time only after
                                                        said approval has been granted by the Customer;
                                                    </li>
                                                    <li>
                                                        Failure reported in Product due to external factors like electricity, plumbing, or
                                                        otherwise;
                                                    </li>
                                                </ol>
                                            </li>
                                            <li>
                                                Due to non-availability of spares or inability of Havells to provide service, Havells may, at
                                                its own discretion terminate the MAINTENANCE CONTRACT and in such case shall refund to the
                                                Customer, the MAINTENANCE CONTRACT charges on pro rate basis, limited to remaining period of the
                                                MAINTENANCE CONTRACT.
                                            </li>
                                            <li>
                                                This MAINTENANCE CONTRACT sets out all the terms and conditions under which Havells agrees to
                                                service the Product and cancels and supersedes all prior agreements, undertakings or arrangement
                                                oral or written between the parties hereto on the subject matter.
                                            </li>
                                            <li>
                                                No modification or variation of this MAINTENANCE CONTRACT is permitted during the subsistence of
                                                MAINTENANCE CONTRACT.
                                            </li>
                                            <li>
                                                Neither party shall be liable for the non-performance of its obligations under this MAINTENANCE
                                                CONTRACT where such failure is due to a force majeure event, i.e., due or attributable to any
                                                act of god, orders, restrictions or regulation of Government, Central or State, war working
                                                conditions, hostilities, riots, civil commotion, strike, lockout, labor trouble, explosion, or
                                                any other cause or circumstance of whatsoever nature beyond control of either party.
                                            </li>
                                            <li>
                                                In case Product needs an up-gradation due to reasons not under control of Havells, Customer
                                                shall accept the up-gradation at the prevailing rate.
                                            </li>
                                            <li>
                                                Breakdown or failure of Product on account of abnormal usage, misuse, voltage fluctuations,
                                                abnormal voltage, and defects in Customer’s electrical installation, service or repair by any
                                                unauthorized person is not covered by this MAINTENANCE CONTRACT. Tampering with or repair of the
                                                Product at any time and under any circumstances whatsoever by anyone with the exception of
                                                Havells’ Authorized Service representative will render the MAINTENANCE CONTRACT null and void
                                                and shall stand terminated forthwith, without prejudice to Havells’ other rights. All failures
                                                resulting from the above will be rectified on chargeable basis.
                                            </li>
                                            <li>
                                                The Customer is neither entitled for refund nor shall assign / transfer this MAINTENANCE
                                                CONTRACT in favor of any third party.
                                            </li>
                                            <li>
                                                MAINTENANCE CONTRACT is offered within Havells Service Network coverage only. In case Customer
                                                moves to a non-coverage area, Customer needs to bring the Product to nearby services network
                                                location, Havells shall not be responsible for providing services to non-service network area.
                                            </li>
                                            <li>
                                                Customer shall register the complaint at Havells call centers only, in any case of any change of
                                                address Customer must inform Havells one week in advance giving full details of his new address.
                                                Havells shall continue to provide maintenance services at new address (subject to clause 24
                                                above). It should be ensured that the Product is installed at the new address by the Havells’
                                                Service representative only, failing which this MAINTENANCE CONTRACT shall stand terminated. The
                                                cost of such re-installation by Havells will be borne by the Customer.
                                            </li>
                                            <li>
                                                Every visit by Havells’ Service representative will be made within reasonable time from receipt
                                                of service request & delivery can be expected only during working hours & working days of
                                                Havells. No services will be provided on National/State public holidays, Political and Regional
                                                regulation.
                                            </li>
                                            <li>
                                                Havells’ liability under this MAINTENANCE CONTRACT is limited to providing services and
                                                replacement of necessary parts as covered under this MAINTENANCE CONTRACT. Havells will not be
                                                liable for damages, death, injuries, health or any consequential damages of whatsoever nature to
                                                any person or property by use or operation of the Product. Maximum liability (direct and
                                                indirect) of Havells under this MAINTENANCE CONTRACT will be limited to the amount paid by the
                                                Customer for availing MAINTENANCE CONTRACT.
                                            </li>
                                            <li>
                                                Customer agrees that any information or data disclosed to Havells under this MAINTENANCE
                                                CONTRACT is non confidential or proprietary to the Customer. Customer agrees that Havells may
                                                collect and process data on Customer’s behalf when it provides service.
                                            </li>
                                            <li>
                                                The validity, interpretation and performance of this MAINTENANCE CONTRACT shall be governed by
                                                the laws of India, and the parties hereby submit to the exclusive jurisdiction of the courts of
                                                competent jurisdiction at Delhi.
                                            </li>
                                        </ol>
                                    </div>
                                </div>
                                <footer><img
                                        src='data:image/png;base64,'
                                        alt='Footer' /></footer>
                            </div>
